import React, { Component } from 'react';
import NavBar from '../components/NavBar';
import 'bulma/css/bulma.css';
import WebFont from 'webfontloader'
import { CoverageMap } from 'istanbul-lib-coverage';

WebFont.load({
    google: {
        families: ['Open Sans Condensed']
    }
});

const styles = {
    background: {
        position: 'absolute',
        justifyContent: 'center',
        zIndex: '-1',
        height: '100%',
        width: '100%',
        background: 'no-repeat center center fixed',
        backgroundSize: 'cover'
    },
    title: {
        fontFamily: 'Open Sans Condensed',
        fontStyle: 'light',
        fontSize: '4vw',
        fontWeight: '500',
        position: 'absolute',
        color: 'white',
        marginLeft: '12%',
        marginTop: '-5%'
        },
    title2: {
        fontFamily: 'Open Sans Condensed',
        fontSize: '4vw',
        fontWeight: '500',
        position: 'relative',
        color: 'white',
        marginLeft: '12%',
        marginTop: '22%'
    },
    slogan: {
        fontFamily: 'Open Sans Condensed',
        fontSize: '1.8vw',
        fontStyle: 'italic',
        position: 'relative',
        color: 'white',
        marginLeft: '54.5%',
        marginTop: '10%'
    }
}

class HomePage extends Component {
    render() {
        return (
        <React.Fragment>

            <img src={ process.env.PUBLIC_URL + '/main-background2.jpg'} style={ styles.background }/>
            <div><NavBar/></div>
            <div className="container">
                <div style={ styles.title }>Ditch all the</div>
                <div style={ styles.title2 }>excel spreadsheets</div>
            </div>
            <div style= {styles.slogan }>Keep track of your job applications where it's meant to</div>
        </React.Fragment>
        );
    }
}

export default HomePage;
